import React, { useState } from "react";
import MainHeader from "./mainHeader";
import Cards from "./cards";

interface MainProps {
  IDs: number[];
  selectCurrency: Function;
  currency: string;
  models: any[];
  fetchModels: Function;
}

function Main(props: MainProps) {
  const [page, setPage] = useState(1);
  const style1: React.CSSProperties = page === 1 ? { color: "orangered" } : {};
  const style2: React.CSSProperties = page === 2 ? { color: "orangered" } : {};
  const style3: React.CSSProperties = page === 3 ? { color: "orangered" } : {};

  return (
    <div className="main">
      <MainHeader num={props.IDs.length} />
      <Cards
        IDs={props.IDs}
        page={page}
        currency={props.currency}
        selectCurrency={props.selectCurrency}
      />
      <div className="pages">
        <button className="page1" style={style1} onClick={() => setPage(1)}>
          1
        </button>
        <button className="page2" style={style2} onClick={() => setPage(2)}>
          2
        </button>
        <button className="page3" style={style3} onClick={() => setPage(3)}>
          3
        </button>
      </div>
    </div>
  );
}

export default Main;
